import React from 'react';
import './App.css';
import WeatherList from './Components/WeatherList';
import { Routes, Route } from 'react-router-dom'
import Weather from './Components/Weather';
import WeatherDay from './Components/WeatherDay';

function App() {

  const weatherInfo = [
    { day: "Sun Nov 27", degrees: "10", status: "cloudy", id: 1 },
    { day: "Mon Nov 28", degrees: "9", status: "sunny", id: 2 },
    { day: "Tue Nov 29", degrees: "5", status: "sunny", id: 3 },
    { day: "Wed Nov 30", degrees: "12", status: "rainy", id: 4 },
    { day: "Thu Nov 31", degrees: "1", status: "sunny", id: 5 },
  ];

  return (
    <div className="appWrapper">
      <Routes>
        <Route path='/' element={<WeatherList weatherInfo={weatherInfo} />} />
        {/* <Route path='/weather/weatherDay' element={<WeatherDay />} /> */}
        <Route path='/weather/weatherDay/:id' element={<Weather />} />
      </Routes>
      {/* <div className='weatherListWrapper'>
        <WeatherList weatherInfo={weatherInfo} />
      </div> */}
    </div>
  );
}

export default App;
